import React from "react";
import { NavLink } from "react-router-dom";

const Header = () => {
	return (
		<div>
			<h1>Billy</h1>
			<NavLink>About</NavLink>
			<NavLink>Product</NavLink>
			<NavLink>Demo</NavLink>
		</div>
	);
};

export default Header;
